import React from 'react';
import Navbar from './Navbar';
import WebXRApp from './WebXRApp';
import AvatarsApp from './WebXRApps/avatars-master/index.html';
// import BrowserApp from './WebXRApps/exokit-browser-master/index.html';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";



const App = props => {



  return (
    <Router>
      <div className="App"> 
        <Route path="/" component={props => <Navbar />} />
        <Route path="/avatars" component={props => <WebXRApp app={AvatarsApp} />} />
        {/* <Route path="/browser" component={<WebXRApp html={{__html: BrowserApp}} />} /> */}

      </div>
    </Router>
  );
}

export default App;
